import "./DisplayUser.css";
import React,{useState} from "react";
function Error(){
    const [isok ,setok]=useState(false)
    const okhandler = ()=>{
        setok(true)
        PaymentResponse.setvalid()
    }
    return<div >
       {
        !isok && <div className="Error"><h1 className="header">Wrong Input</h1><p>Wrong input age must be {'(>0)'}</p> <br></br><button onClick={okhandler}>ok</button></div>
       }
    </div>

}
export default Error;
